import logo from './logo.svg';
import './App.css';
import Profile from './components/profile/Profile'
import Statistics from './statistical-data.json'
import user from './user.json'


function App() {
  return (
    <div className="App">
      <Profile user={user} avatar={user.avatar} name={user.name} tag={user.tag} location={user.location}
        followers={user.followers} views={user.views} likes={user.likes} />
      <Statistics />
    </div>
  );
}

export default App;
